window.bookSummaryJSON = "<p><b>Two daddies are better than one...</b></p> <p>I'm caught between two dominant daddies - best friends who compete at everything. Both Bear and Sawyer have muscles for days, but they want to know who’s better in bed. And they want <i>me</i> to judge.</p> <p>Their game, their rules, but I can play along.</p> <p>They call the shots, in and out of bed, and disobedience has delicious consequences.</p> <p>As the final round approaches and the stakes are raised, I’m hoping this isn’t just a game.</p> <p>I'm falling, fast, and I don't think I can choose. They're both playing to win. But which one’s playing for keeps?</p> <p><i>Her Dueling Daddies</i> is an MFM novella expanded from the short story in the Daddy's Demands box set (no longer available). Fans of <i>Her Marine Daddy</i> will enjoy Bear, Evie, &amp; Sawyer's story. </p>"; 
